import React from 'react';
import './Layout.css';
import Card from './Card';

const Layout = () => {
  return (
    <div className="layout">
      <div className="layout-section"><Card /></div>
      <div className="layout-section">2</div>
      <div className="layout-section">3</div>
      <div className="layout-section">4</div>
    </div>
  );
};

export default Layout;
